import { Table, Button } from 'reactstrap';
import React, { Component } from 'react';
import carrito from '../Json/carrito.json';



export default class TableShopping extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
        tableData: carrito,
    };
}


  render() {
    let rows = this.state.data.map(travel => {
      return <TravelInfo key = {
        travel.Num
      }
      data = {
        travel
      }
      />
    })
    return (
      <Table responsive>
        <thead>
          <tr>
            <th>Num</th>
            <th>Nombre Tour</th>
            <th>Descripcion</th>
            <th>Cantidad</th>
            <th>Precio Unitario</th>
            <th>Precio Usuario</th>
            <th>Eliminar</th>
          </tr>
        </thead>
        <tbody>
{
  tableData
}

        </tbody>
      </Table>
    );
  }
}

const TravelInfo = (props) => {
  return (
    <tr>
      <td>
        { props.tableData.Num }
      </td>
      <td>
        { props.tableData.NombreTour }
      </td>
      <td>
        { props.tableData.Descripcion }
      </td>
      <td>
        { props.tableData.Cantidad }
      </td>
      <td>
        { props.tableData.PrecioUnitario }
      </td>
      <td>
        { props.tableData.PrecioUsuario }
      </td>
    </tr>
  );
}
